import React, { useState } from 'react';
import './header.css';
import logo from '../../imagenes/logo.png';

const Header = ({ handleFormVisibilityRegistro, handleFormVisibilityInicioSesion, handleSearch }) => {
  const [searchTerm, setSearchTerm] = useState('');

  const handleChange = (event) => {
    setSearchTerm(event.target.value);
  };

  const handleSearchClick = () => {
    handleSearch(searchTerm);
  };

  return (
    <header>
      <div className="logoDiv">
        <img className="logoHeader" src={logo} alt="Logo" />
      </div>

      <div className="input-group">
        <input
          type="text"
          className="form-control input-lg"
          aria-label="Recipient's username"
          aria-describedby="button-addon2"
          value={searchTerm}
          onChange={handleChange}
        />
        <button className="btn btn-outline-secondary btn-lg" type="button" onClick={handleSearchClick}>
          Buscar
        </button>
      </div>

      <div className="login">
        <a className="dropbtn">Iniciar sesi√≥n / Registrarse</a>
        <div className="login-content">
          <button onClick={handleFormVisibilityInicioSesion}>Inicio</button>
          <button onClick={handleFormVisibilityRegistro}>Registrarse</button>
        </div>
      </div>
    </header>
  );
};

export default Header;
